sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {TransformApiHelpers} params.helpers
 */
function evaluateProperty({
    api,
    helpers
}) {
    if(api.state.collapseAll){
        return [];
    }
    var arr = [];
    var result = [];
    var artifacts = api.data.get_app_artifacts_1.output.result.artifacts;
    artifacts.forEach(function(artifact) {
        arr = [];
        arr.push(artifact.id);
        result.push(arr);
        artifact.types.forEach(function(type){
            type.artifacts.forEach(function(artifact){
                arr = [];
                arr.push(type.id);
                arr.push(artifact.id);
                result.push(arr);
            });
        });
    });
    return result;
}
